import React, { useEffect, useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const AllData = () => {
  const [userSubmissions, setUserSubmissions] = useState([]);

  useEffect(() => {
    fetch('http://backend-dev2.us-east-1.elasticbeanstalk.com/get_logins')
      .then(response => response.json())
      .then(data => setUserSubmissions(data))
      .catch(error => console.error('Failed to retrieve user submissions:', error));
  }, []);

  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark" style={{ backgroundColor: '#004571' }}>
        <a className="navbar-brand" href="/">Very Bad Bank</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNavAltMarkup">
          <div className="navbar-nav">
            <a className="nav-item nav-link" href="/">Home</a>
            <a className="nav-item nav-link" href="/create_account">Create Account</a>
            <a className="nav-item nav-link" href="/deposit">Deposit</a>
            <a className="nav-item nav-link" href="/withdraw">Withdraw</a>
            <a className="nav-item nav-link active" href="/all_data">All Data</a>
          </div>
        </div>
      </nav>

      <main role="main" className="container mt-5">
        <div className="card">
          <div className="card-body">
            <h5 className="card-title text-center">All Data</h5>
            <div className="mb-3 text-center">
              <p className="card-text">User Submissions:</p>
              <ul id="userSubmissions" className="list-group">
                {userSubmissions.map((user, index) => (
                  <li key={index} className="list-group-item">
                    Email: {user.email}, Username: {user.username}, Password: {user.password}, Date: {new Date(user.loginDate).toLocaleString()}
                  </li>
                ))}
              </ul>
            </div>
            <div className="card-text">
              <div className="container">
                <div id="userDataCard" className="card">
                  <div className="card-header">All Data</div>
                  <div className="card-body">
                    <p className="card-text">User Data: <span id="userData"></span></p>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </main>

      <footer className="py-5" style={{ backgroundColor: '#efefef' }}>
        <div className="container">
          <p className="text-center">©2024 Very Bad Bank, Inc. All rights reserved.</p>
        </div>
      </footer>

      <style jsx>{`
        .navbar, .card-header {
          background-color: #004571;
          color: white;
        }
        .btn-primary, .nav-link:hover {
          background-color: #ff681f;
          border-color: #ff681f;
        }
        .card {
          background-color: #fdfcfd;
        }
        body, .card-text {
          color: #000000;
        }
        footer {
          background-color: #efefef;
        }
      `}</style>
    </div>
  );
};

export default AllData;
